import React, { useState } from 'react';
import { WrapperDrawer } from './styled.js';
import LeftMenu from './LeftMenu';
import RightMenu from './RightMenu';

const NavBar = () => {
  const [visible, setvisible] = useState(false);

  //  const showDrawer = () => {
  //    setvisible(true);
  //  };
  const onClose = () => {
    setvisible(false);
  };
  return (
    <nav className='menuBar'>
      <div className='logo'>
        <a href=''>logo</a>
      </div>
      <div className='menuCon'>
        <div className='leftMenu'>
          <LeftMenu />
        </div>
        <div className='rightMenu'>
          <RightMenu />
        </div>

        <WrapperDrawer
          title='Basic Drawer'
          placement='right'
          closable={false}
          onClose={onClose}
          visible={visible}>
          <LeftMenu />
          <RightMenu />
        </WrapperDrawer>
      </div>
    </nav>
  );
};

export default NavBar;
